    bool nummines(char* grid, int pos, int cnt) {
        int L = pos - 1, U = pos - N, R = pos + 1, D = pos + N;
        int UL = pos - 1 - N, UR = pos - N + 1, DL = pos + N - 1, DR = pos + N + 1;
        return int(grid[L]) + int(grid[U]) + int(grid[R]) + int(grid[D]) + int(grid[UL]) + int(grid[UR]) + int(grid[DL]) + int(grid[DR]) == 48 * 8 + cnt;
    }

    bool connected(char* grid, int pos, int cnt) {
        if (cnt == 0 || cnt == 8)
            return true;
        int L = pos - 1, U = pos - N, R = pos + 1, D = pos + N;
        int UL = pos - 1 - N, UR = pos - N + 1, DL = pos + N - 1, DR = pos + N + 1;
        int i;
        char list[9];
        char tmp;
        list[0] = grid[L];
        list[1] = grid[DL];
        list[2] = grid[D];
        list[3] = grid[DR];
        list[4] = grid[R];
        list[5] = grid[UR];
        list[6] = grid[U];
        list[7] = grid[UL];
        while (list[0] == '0') {
            tmp = list[0];
            list[0] = list[7];
            list[7] = list[6];
            list[6] = list[5];
            list[5] = list[4];
            list[4] = list[3];
            list[3] = list[2];
            list[2] = list[1];
            list[1] = tmp;
        }
        while (list[7] == '1') {
            tmp = list[0];
            list[0] = list[7];
            list[7] = list[6];
            list[6] = list[5];
            list[5] = list[4];
            list[4] = list[3];
            list[3] = list[2];
            list[2] = list[1];
            list[1] = tmp;
        }
        for (i = 0; i < 8; i++) {
            if (list[i] == '0')
                break;
        }
        if (cnt != -1)
            return i == cnt;
        else {
            for (; i < 8; i++) {
                if (list[i] == '1')
                    return false;
            }
            return true;
        }
    }

    bool disjoint(char* grid, int pos, int cnt) {
        if (cnt > 4)
            return false;
        int L = pos - 1, U = pos - N, R = pos + 1, D = pos + N;
        int UL = pos - 1 - N, UR = pos - N + 1, DL = pos + N - 1, DR = pos + N + 1;
        char list[9];
        list[0] = grid[L];
        list[1] = grid[DL];
        list[2] = grid[D];
        list[3] = grid[DR];
        list[4] = grid[R];
        list[5] = grid[UR];
        list[6] = grid[U];
        list[7] = grid[UL];
        for (int i = 0; i < 8; i++) {
            if (list[i] == '1' && (list[(i + 1) % 8] == '1' || list[(i - 1) % 8] == '1'))
                return false;
        }
        return true;
    }

    bool checker(char* grid) {
        int pos, c, cnt;
        bool a0, a1;
        for (int i = 0; i < 819; i += 3) {
            pos = (int)(*(short*)(challenge + i));
            c = (int)challenge[i + 2];
            a0 = false, a1 = false, cnt = 0;
            if (c >= 128) {
                cnt += 8;
                c -= 128;
            }
            if (c >= 64) {
                cnt += 4;
                c -= 64;
            }
            if (c >= 32) {
                cnt += 2;
                c -= 32;
            }
            if (c >= 16) {
                cnt += 1;
                c -= 16;
            }
            if (c >= 8) {
                a0 = true;
                c -= 8;
            }
            if (c >= 4) {
                a1 = true;
                c -= 4;
            }
            if (c >= 2)
                cnt = -1;
            // printf("[DEBUG] i: %d | pos: (%d, %d) | isConnected: %d | isDisjoint: %d | numMines: %d\n", i, pos / 27, pos % 27, a0, a1, cnt);

            if (a0 && a1 && !connected(grid, pos, cnt) && !disjoint(grid, pos, cnt)) {
                return false;
            }
            if (a0 && !a1 && !connected(grid, pos, cnt)) {
                return false;
            }
            if (!a0 && a1 && !disjoint(grid, pos, cnt)) {
                return false;
            }

            if (cnt != -1 && !nummines(grid, pos, cnt)) {
                return false;
            }
            if (grid[pos] == '1') {
                return false;
            }
        }
        return true;
    }

